def test_parse_tvs_empty():
    response_data = {
        "success": True,
        "data": {
            "dataTimestamp": 1744124400,
            "breakdown": {"canonical": [], "native": [], "external": []},
        },
    }
    actual = parse_tvs(response_data, L2BeatProject(id="funki", slug="funki"))
    assert actual == []


